import Header from './Header';
import Footer from './Footer';
import ICT from './ICT';
import About from './about';
import Services from './Services';
import Partners from './Partners';
import '../styles/main.css';
const Layout = () => (
  <div>
    <Header />
    <ICT />
    <About />
    <Services />
    <Partners />
    <Footer />
  </div>
);
export default Layout;
